import React, { useState } from "react";

function CreateArea() {
  const [note, setNote] = useState({
    title: "",
    content: "",
  });

  return (
    <div>
      <form>
        <input name="title" value={note.title} placeholder="Title"></input>
        <textarea
          name="content"
          value={note.content}
          placeholder="Take a note..."
          rows="3"
        ></textarea>
        <button>Add </button>
      </form>
    </div>
  );
}

export default CreateArea;
